css:
@keyframes bracket-animation {
  from {
    border-color: #808393;
  }
  40% {
    border-color: rgba(56, 58, 66, 0.615);
  }
  to {
    border-color: rgba(56, 58, 66, 0.45);
  }
}
atom-text-editor.editor .bracket-matcher .region {
  animation: bracket-animation 0.85s;
  border: 1px solid rgba(56, 58, 66, 0.45);
}
